                        cb(null, buildModuleNotFoundError(dep, fromDecl));
                        return;
                    }

                    decl = modulesStorage[dep].decl;
                } else {
                    decl = dep;
                }

                decls.push(decl);

                startDeclResolving(decl, path, onDeclResolved);
            }
